import Link from 'next/link';

const Sobre = () => {
  return (
    <div>
      <h1>Sobre</h1>
      <div>
        <Link href="/sobre">
          <a>Sobre</a>
        </Link>
      </div>
    </div>
  )
};

export default Sobre;
